import React, { useState, useEffect } from 'react';
import Card from "./Card"
import "./card.css"

let DUMMY_EXPENSE = [];


const Data = () => {
    const [expenses, setExpenses] = useState(DUMMY_EXPENSE);
    // const d = expenses
    // console.log(expenses);
    // dd.push(d)
    // console.log(dd);
    
    // expenses.map((val) => {
        //     console.log(val);
        // })
        
        // let dd = []

    function fetchData() {
        fetch("https://s3-ap-southeast-1.amazonaws.com/he-public-data/studiod9c0baf.json").then(
            res => {
                return res.json();
            }
        ).then(
            data => {
                // console.log(data);
                setExpenses(data);
                // dd.push(data)
                // data.map((val) => {
                //     // console.log(val);
                //     dd.push([val.song])
                // })
            }
        )
    }


    useEffect(() => {
        fetchData()
    }, []);


    // console.log(dd);


    return (
        <div>
            {/* <h1 className='heading_style' >
                Home Page
            </h1> */}

            {/* {console.log(expenses[0])} */}
            {expenses}
            {/* <Card 
                imgsrc={expenses[1].cover_image}
                song={expenses[1].song}
                artist={expenses[1].artists}
                link={expenses[1].url}
            /> */}
        </div>
    )
}


export default Data;
